export enum VMWizardActionLabels {
  YAML = 'New from YAML',
  WIZARD = 'New with Wizard',
  IMPORT = 'Import with Wizard',
}

export enum VMWizardName {
  YAML = 'yaml',
  WIZARD = 'wizard',
}

export enum VMWizardMode {
  IMPORT = 'import',
  TEMPLATE = 'template',
  VM = 'vm',
}

export enum VMWizardView {
  ADVANCED = 'advanced',
  SIMPLE = 'simple',
}
